import React from "react";
import {
    Col,
    FormGroup,
    Label,
    Button,
    ModalBody,
    ModalFooter,
    Input,
    Modal,
    ModalHeader
} from "reactstrap";
import Translate from "../../../Translate";
import {FileText} from "react-feather";

const SupplierModal = (props) => {
    function modalBodyContent() {
        if (props.type === "delete") {
            return (
                <ModalBody>Դուք համոզված ե՞ք ջնջել</ModalBody>
            )
        } else {

            return (

                <ModalBody>
                    <form>
                        <FormGroup row>

                            <Label for="Name" sm={3}><Translate name="name"/>:</Label>
                            <Col sm={9}>
                                <input
                                    className={`form-control  ${props.errors.name ? 'is-invalid' : ''}`}
                                    type="text"
                                    id="firstName"
                                    value={props.supplier.name}
                                    onChange={event => props.setModalValues("name", event.target.value)}
                                />
                            </Col>
                        </FormGroup>

                        <FormGroup row>
                            <Label for="HH" sm={3}><Translate name="hh"/>:</Label>
                            <Col sm={9}>
                                <Input type="text" id="HH" name="hh"/>
                                <input
                                    className={`form-control  ${props.errors.hh ? 'is-invalid' : ''}`}
                                    type="text"
                                    id="HH"
                                    value={props.supplier.hh}
                                    onChange={event => props.setModalValues("hh", event.target.value)}
                                />
                            </Col>
                        </FormGroup>

                        <FormGroup row>
                            <Label for="hvhh" sm={3}>ՀՎՀՀ:</Label>
                            <Col sm={9}>
                                <Input type="text" id="HVHH" name="hvhh"/>
                                <input
                                    className={`form-control  ${props.errors.hvhh ? 'is-invalid' : ''}`}
                                    type="text"
                                    id="HVHH"
                                    value={props.supplier.hvhh}
                                    onChange={event => props.setModalValues("hvhh", event.target.value)}
                                />
                            </Col>
                        </FormGroup>

                        <FormGroup row>
                            <Label for="eventRegInput4" sm={3}>Հասցե:</Label>
                            <Col sm={9}>
                                <Input type="email" id="eventRegInput4" name="email"/>
                            </Col>
                        </FormGroup>

                        <FormGroup row>
                            <Label for="eventRegInput5" sm={3}>Բանկ:</Label>
                            <Col sm={9}>
                                <Input type="tel" id="eventRegInput5" name="contact"/>
                            </Col>
                        </FormGroup>

                        <FormGroup row>
                            <Label for="eventRegInput5" sm={3}>Տնօրեն:</Label>
                            <Col sm={9}>
                                <Input type="tel" id="eventRegInput5" name="contact"/>
                            </Col>
                        </FormGroup>
                        <FormGroup row>
                            <Label for="eventRegInput5" sm={3}>Հեռ:</Label>
                            <Col sm={9}>
                                <Input type="tel" id="eventRegInput5" name="contact"/>
                            </Col>
                        </FormGroup>

                    </form>

                </ModalBody>
            )

        }

    }

    return (
        <React.Fragment>
            <Modal isOpen={props.modal[props.type]} toggle={() =>{ props.toggleModal(props.type)}} size="lg">
                <ModalHeader toggle={() => {props.toggleModal(props.type)}}><Translate
                    name={props.type + "supplier"}/></ModalHeader>
                {modalBodyContent()}
                <ModalFooter>
                    <Button color="primary" type="submit" onClick={function () {
                        props.supplierActions(props.type, props.supplier);
                    }}>
                        <Translate name="confirm"/>
                    </Button>
                </ModalFooter>
            </Modal>

        </React.Fragment>
    );

};

export default SupplierModal;
